function model_vertices(model_json) {
    let vertices = [];
    for (let triangle of model_json.triangles) {
        let a = model_json.positions[triangle[0]];
        let b = model_json.positions[triangle[1]];
        let c = model_json.positions[triangle[2]];
        vertices.push(vec3_new(a[0], a[1], a[2]));
        vertices.push(vec3_new(b[0], b[1], b[2]));
        vertices.push(vec3_new(c[0], c[1], c[2]));
    }
    return vertices;
}

function model_normals(model_json) {
    let normals = [];
    for (let triangle of model_json.triangles) {
        let a = model_json.normals[triangle[0]];
        let b = model_json.normals[triangle[1]];
        let c = model_json.normals[triangle[2]];
        normals.push(vec3_new(a[0], a[1], a[2]));
        normals.push(vec3_new(b[0], b[1], b[2]));
        normals.push(vec3_new(c[0], c[1], c[2]));
    }
    return normals;
}

